        <div class="col-md-8">
        <h3>New Altosid<sup>&reg;</sup> XR-G Ultra Tech Brochure  </h3>
        <p>The latest to join the Central Life Sciences product lineup, <a href="~/link.aspx?_id=37EDA4DAF100423FBDF1C38B117F0F81&amp;_z=z">Altosid<sup>&reg;</sup> XR-G Ultra</a>&nbsp;is a new carbon-free, clean (S)-methoprene granule larvicide formulation that controls adult mosquito emergence with a new consistent mode of action. Learn more in our new brochure below.
        </p>
        <div class="sxa-btn sxa-btn-primary"><a href="-/media/F99B02A81B2B4B8B8E8E5D008AB8CE28.ashx">DOWNLOAD BROUCHURE</a></div>
