        <div class="col-md-8">
        <h3>Altosid<sup>&reg;</sup> Liquid Larvicides Efficacy Brochure</h3>
        <p><a href="~/link.aspx?_id=D2C5D8FC78724EAEAECBFE55650B7B3D&amp;_z=z">Altosid<sup>&reg;</sup> Liquid Larvicides</a> have been created after extensive research into the intricacies of natural biochemical and physiological development of insects. See the results of our field test, product features, and more in our new efficacy brochure.</p>
        <div class="sxa-btn sxa-btn-primary"><a href="-/media/21346A44CDBE436D9945E1767089AD56.ashx">DOWNLOAD BROUCHURE</a></div>
        </div>
        </div>
