        <div class="col-md-8">
        <h3>S-Methoprene value from Central Life Sciences</h3>
        <p>The efficacy of <a href="~/link.aspx?_id=C28D77B96C2D49BB8A19D506EBDFB287&amp;_z=z">Altosid<sup>&reg;</sup> P35</a>&nbsp;can&rsquo;t be matched. In fact, <a href="~/link.aspx?_id=C28D77B96C2D49BB8A19D506EBDFB287&amp;_z=z">Altosid<sup>&reg;</sup> P35</a>&nbsp;is proven to provide residual control for at least 35 days&mdash; that&rsquo;s an extra week of mosquito control compared to other products in the industry. Read the complete Altosid<sup>&reg;</sup> larvicides efficacy study below, and the see results for yourself.</p>
